import React from 'react'
import Illustration from '../assets/Capture.PNG'

const Home = () => {
    return (
        <div>
            <h1 className="float-left font-nunito font-extrabold  ">Need a hand in  <br/>managing college work?? <br/>We got you!</h1>
            <img src={Illustration} className='w-2/5 float-right my-12 mr-6' alt="pic"></img>

            

        </div>
    )
}

export default Home
